import React from 'react';
import './GameCard.css';
import star from '../../imgs/star.png';
// import { Link } from 'react-router-dom';


// {g.apId} name={g.name} img={g.img_url} genres={g.genres}

export default function GameCard({ id, name, img, genres }) {
  //console.log(props.game); 

  function handleClick(e) {
    alert('elegiste juego');
  }

  return (
    <div className="gcardcont" onClick={handleClick}>
      {/* <Link to='/gamedetail/:id' className="link_ng"> */}
      <p className="gcname">{name}</p>
      {/*</Link> */}
      <div className="star">
          <img className="star_img" src={star} alt="star"/>
          <p className="gdpT"><b className="gdt">8</b></p>
        </div>
      {/* <img className="gImg" src={img} alt="game_image" /> */}
        <p className="pgenre"> {genres} </p>
    </div>
  )
}
